using UnityEngine.UI;namespace DataUI.ListItems {    public class ExistingActivateDialogueResult : ExistingResult {        public void InitialiseMe(string resultID, string dialogueID, string descriptionTxt) {            SetMyID(resultID);            transform.Find("DialogueID").GetComponent<Text>().text = dialogueID;            transform.Find("DialogueDescription").GetComponent<Text>().text = descriptionTxt;        }    }}